import request from '@/utils/request'; // 查询

export function querySynthesis(query) {
  return request({
    url: "/ems/indicatorsSynthesisEnergy",
    method: 'get',
    params: query
  });
} // 查询

export function queryUnits(workCenterLevel) {
  var query = {
    workCenterLevel: workCenterLevel
  };
  return request({
    url: "/ems/indicatorsSynthesisEnergy/Units",
    method: 'get',
    params: query
  });
} // 新增

export function createSynthesis(data) {
  return request({
    url: "/ems/indicatorsSynthesisEnergy",
    method: 'post',
    data: data
  });
} // 更新

export function updateSynthesis(rowId, data) {
  return request({
    url: "/ems/indicatorsSynthesisEnergy/".concat(rowId),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteSynthesis(data) {
  return request({
    url: "/ems/indicatorsSynthesisEnergy",
    method: 'delete',
    data: data
  });
}
